const ExpenseItem = (props) => {
  return (
    <div className="expense-item">
      <div className="expense-item__date">May 2022, 20</div>
      <div className="expense-item__info">
        <div className="expense-item__infoTitle">Food</div>
        <div className="expense-item__infoAmount">500</div>
      </div>
    </div>
  );
};

export default ExpenseItem;
